Leon van der Zanden   Zwarte hond (Dutch)


Een &quot;aanstormend&quot; talent! Of beter gezegd, een talent. Misschien is dit wel een snelle conclusie. Maar na het zien van zijn derde avondvullende programma &quot;Zwarte Hond&quot; kan niet anders worden geconcludeerd. 
Deze DVD bevat meer multitalent Leon van der Zanden bekend van MTV's &quot;Pimp my room&quot; en het programma &quot;Olifantendoders&quot; 




